import './App.css';

import Introduction from './components/introduction';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p>
          Maja Schermuly's Website
        </p>        
      </header>
      <Container>
                <Row>
                    <Col>1 of 2</Col>
                    <Col>2 of 2</Col>
                </Row>
                <Row>
                    <Col>1 of 3</Col>
                    <Col>2 of 3</Col>
                    <Col>3 of 3</Col>
                </Row>
            </Container>

    </div>
  );
}

export default App;
